add_action('vc_enqueue_font_icon_element', 'cynic_load_vc_minilineicons');

function cynic_load_vc_minilineicons($type)
{
    if ($type == 'minilineicons') {
        $path = apply_filters('cynic_minilineicons_font_css_url', get_template_directory_uri() . '/css/illustration/miniline.css');
        wp_enqueue_style('minilineicons', $path);
    }
}

function cynic_load_backend_minilineicons($page)
{
    if (in_array($page, array('post.php', 'post-new.php'))) {
        $path = apply_filters('cynic_minilineicons_font_css_url', get_template_directory_uri() . '/css/illustration/miniline.css');
        wp_enqueue_style('minilineicons', $path);

    }
}

